// src/messagingKeys/contractResolvers/errors.ts
var MessagingKeyNotFoundInContractError = class extends Error {
  constructor() {
    super(`Messaging key not found in contract.`);
  }
};
var InvalidContractResponseError = class extends Error {
  constructor(problem) {
    super(`Messaging key contract returned invalid response. ${problem}}`);
    this.problem = problem;
  }
};

export {
  MessagingKeyNotFoundInContractError,
  InvalidContractResponseError
};
